"""Os videogames neste banco de dados so divididos em 12 gneros diferentes. Essas caracterizaes gerais de cada gnero so explicadas abaixo:

* Ao - Desafios baseados em preciso e reao.
* Aventura - Explorao e uma narrativa guiada pela histria. Os quebra-cabeas tambm costumam ser incorporados.
* Fighting - Combate entre normalmente dois jogadores onde so frequentemente necessrias entradas tcnicas nicas.
* Plataforma - O movimento, como pular e escalar,  usado para atravessar um ambiente.
* Puzzle - Resoluo de problemas e vrios desafios lgicos. Muitas vezes incorporado em outros gneros.
* Corrida - Conduzindo algum meio de transporte contra outros ou contra o tempo
* Role-playing - Sistemas baseados em progresso onde um personagem do jogador se torna mais forte, muitas vezes atravs de uma histria.
* Shooter - Armamento de longo alcance, mais comumente armas, em combate para causar dano aos oponentes. Os oponentes podem ser outros jogadores ou oponentes controlados pela IA.
* Simulao - Sistemas que visam simular a realidade (real ou fictcia).
* Esportes - Recriaes de esportes, mas em um videogame.
* Estratgia - Jogabilidade baseada em planejamento habilidoso e cuidadoso para atingir um objetivo.
* Misc - Qualquer jogo que no se enquadre em nenhuma das categorias acima. Notavelmente, jogos de msica e jogos de festa se enquadram nesta categoria
"""

