"""Uma breve explicao retirada do site do ESRB para cada classificao:

Pela Classificao oficial da ESRB - https://www.esrb.org/ratings-guide/ , segue seu glossrio ;

* E =>( Everyone)  Contedo generalizado para todas as idades, contendo mnimo de fantasia, violncias ou animaes em cartoons.

* E10 => Contedo mais adequada para acima de 10 anos podendo conter fantasia , violncia ou animaes me cartons mais frequentes de intensidade mnima

* T => ( Teens ) Contedo mais adequado para acima de 13, podendo conter fantasia, humor, sangue e uso frequente de expresses lingusticas.

* M => ( Mature ) Contedo mais adequada para acima de 17 anos podendo conter intensa violncia , sangue e uso inadequado de expresses lingusticas .

*  A => ( Adults only) Contedo adequado para adultos acima de 18 podendo conter prolongadas cenas de violncia, apostas , sangue e cenas expressivamente sexualizadas .

* RP => ( Rating Pending ) Classificao ainda pendente.

Alguns menos comuns so explicados abaixo:

* EC - Primeira Infncia. Contedo geralmente adequado para maiores de 3 anos. No contm material que os pais considerem inapropriado.
* K-A - Crianas para Adultos. O nome anterior da categoria de classificao * * 'E' para 'Todos'.
* RP - Classificao pendente. O jogo ainda no recebeu uma classificao final. Substitudo assim que a classificao for atribuda
K-A foi renomeado para E em 1998. EC tambm foi descontinuado em 2018 devido  falta de uso, pois E tambm era aplicvel a ttulos com a classificao EC. Assim, para nossa explorao e anlise, estaremos rotulando esses jogos para ter a classificao E para ser consistente com as classificaes modernas.
Tambm notamos que as classificaes de jogos s foram introduzidas em 1994, ento muitos jogos antes dessa era podem no ter uma classificao.

"""

