"""Mais de 50% das pontuaes de usurios e crticos esto ausentes. Isso  muito! Normalmente, voc deve descartar recursos com muitos valores ausentes, mas aqui acho que as pontuaes so inestimveis para a previso de vendas, ento terei que encontrar uma maneira de contornar o problema.

Existem discrepncias( outliers) nas colunas de vendas. Eles podem ser teis para treinamento, pois indicam jogos mais vendidos, mas por enquanto vou remov-los e talvez adicion-los mais tarde.

Novamente, peguei essa funo muito til de William Koehrsen. Aqui um outlier  definido como um valor maior que (ou menor que) terceiro quartil (primeiro quartil) mais 3 intervalos interquartis (menos 3 intervalos interqurtile)
"""

def rm_outliers(df, list_of_keys):
    df_out = df
    for key in list_of_keys:
        #Calcular primeiro e terceiro quartil
        first_quartile = df_out[key].describe()["25%"]
        third_quartile = df_out[key].describe()["75%"]

        # Intervalo interquartil
        iqr = third_quartile - first_quartile

        # Remover valores discrepantes
        removed = df_out[(df_out[key] <= (first_quartile - 3 * iqr)) |
                    (df_out[key] >= (third_quartile + 3 * iqr))] 
        df_out = df_out[(df_out[key] > (first_quartile - 3 * iqr)) &
                    (df_out[key] < (third_quartile + 3 * iqr))]
    return df_out, removed

