"""### Tipos de mtricas exploradas 
* Erro Mdio Absoluto - MAE
O erro mdio absoluto, MAE (da sigla em ingls Mean Absolute Error),  calculado a partir da mdia dos erros absolutos, ou seja, utilizamos o mdulo de cada erro para evitar a subestimao, isso porque, o valor  menos afetado por pontos especialmente extremos (outliers).

Cada erro, pode ser interpretado como a diferena entre Y e  e assim, temos:
$$ MAE = \frac{1}{n}\sum|y_i test - y_ipred |$$

* Erro Quadrtico Mdio - MSE

O erro quadrtico mdio, MSE (da sigla em ingls Mean Squared Error),  comumente usado para verificar a acurcia de modelos e d um maior peso aos maiores erros, j que, ao ser calculado, cada erro  elevado ao quadrado individualmente e, aps isso, a mdia desses erros quadrticos  calculada
$$ MSE = \frac{1}{n}\sum(y_i test - y_ipred )^{2}$$

* Raiz Quadrada do Erro Mdio - RMSE
A raiz quadrada do erro mdio, RMSE (da sigla em ingls Root Mean Squared Error)  apenas a raiz quadrada do MSE, onde o erro retorna  unidade de medida do modelo (no MSE, a unidade de medida  quadrtica).

 frequentemente usada em sries temporais por ser mais sensvel a erros maiores devido ao processo de quadratura que a produziu.

A equao para clculo, d-se por:
$$ RMSE = \sum\frac{(y_i test - y_ipred )^{2}}{n}$$
"""

